        'max': 2
    });

    if(sex==1){
        sex='M';
    }else{
        sex='F';
    }

        const arrjs = {
            "var_firstName": n1,
            "var_secondName": n2,
            "var_firstSurname": n3,
            "var_secondSurname": n4,
            "big_address_id_FK": addre,
            "cha_garder": sex
        };
        //console.log(arrjs);
        return arrjs;
    
}

