    //console.log(result)
    res.json(result.recordset)
};

export const newArea = async (req, res) => {
    const pool = await getConnection();
    let con = 1;
    while(con <= 25){
        try {
            let gen = fakerArea();
            console.log(gen);
            await pool.request()
            .query("INSERT INTO HUMAN_R.AREA VALUES ("
            +con+",'" 
            +gen.var_name+"')");
