    while(con <= 69993){
        let gen = fakerAdress();
        await pool.request()
        .query("INSERT INTO HUMAN_R.LIST_ADDRESS(tex_reference,int_country_id_FK,big_departament_id_FK,big_city_id_FK,big_suburn_id_FK) VALUES ('"
